import React, { Component } from 'react';
import Head from '../components/Head';

export default class Student extends Component {
    constructor(props) {
        super(props);
        this.state = {
            user: this.props.user
        }
        console.log(this.props)
    }
    
    render() {
        return (
            <div>
				<Head />
			</div>
        );
    }
}
